import React from 'react'
import './App.css'
import Subsection from './Subsection.js'

const Section = (section) => {
	return(
		<div style={{margin: '5px'}}>

				<h2>Sections</h2>

				{
					section.map((item) =>{
						return(

				<div>
					<h3>{item.number} <button>Add Section</button></h3>

				<ul>
					<li>Instructor: {item.instructor}</li>
					<li>Location: {item.location}</li>
					<li>Metting Times
						<ul>
						{
							item.details.map((subitem, i) => 
						<li>{i}:{subitem}</li>
						)
						}
						</ul>
					</li>
				</ul>) 
				<div>
					<Subsection subsection={section.subsections}/>
				</div>
				</div>)}
				)
				}

			</div>
	)
}

